import React from 'react';
import styled from 'styled-components';


const Page = styled.div`
  width:100%;
  height:100%;
  position:absolute;
  left:90%;
  background-color:blue;
`


function MissSuggestions(props){

  return (
    <Page>miss suggestions</Page>
  )

}

export default MissSuggestions;
